import React from 'react';
import styled from 'styled-components';
import { Container } from './../shared/global';

const Header = styled.div`
	padding: 5rem 0;
`;

const About = () => {
	return (
		<Container>
			<Header>
				<img alt="logo"></img>
			</Header>
		</Container>
	);
};

export default About;
